import styled from 'styled-components';
import React from 'react';
import LogoEscritaBranco from "../assets/Logo Escrito Branco PNG.png";

const HeaderContainer = styled.div`
    background-color: #64b3cc;
    width: 100%;
    height: 100px;
    display: flex;
    justify-content: center;
    align-items: center;
    position: fixed;
`;

const StyledHeader = styled.header`
    margin-top: -20px; /* Ajuste a margem superior conforme necessário para evitar a sobreposição */
`;

const StyledImage = styled.img`
    width: 120px;
    height: auto;
`;

function Header(){
    return(
        <HeaderContainer>
            <StyledHeader />
            <StyledImage src={LogoEscritaBranco} alt="Imagem" />
        </HeaderContainer>
    );
}

export default Header;
